INSERT INTO `product_content` VALUES (33,'2025-06-11 15:26:44.000000','這是一款功能強大的酷睿i7處理器，擁有8核心16線程，基礎頻率3.8GHz，睿頻可達5.1GHz。適合遊戲、內容創作和多任務處理。','高性能桌面處理器，手動添加用於API測試。','手動插入的酷睿i7處理器','2025-06-11 15:26:44.000000',33),(40,'2025-06-11 16:52:11.164618','這是一款頂級遊戲顯卡，採用最新架構，擁有24GB GDDR6X顯存，提供無與倫比的遊戲體驗和內容創作能力。支持最新的光線追踪技術和DLSS 3.0。','體驗極致遊戲性能，光線追踪，8K遊戲就緒。','全新高性能遊戲顯卡 GTX 4090','2025-06-11 16:52:11.164618',40),(42,'2025-06-14 16:35:21.198198','此顯卡為蝦皮購買二手顯卡。\n\n無盒裝，橘色防塵塞前賣家還留著，黑色HDMIx1及金手指保護套則自己另外購買補上。\n\n需接8pin供電。(官方建議瓦數400w以上)\n\n上機測試過所有輸出接口(DPx2 HDMIx2 DVI)都正常。\n\n風扇有智慧停轉，有拆卡做過簡單清潔+換散熱膏。\n\n簡單燒機測試20分鐘最高溫度69度沒出現問題。\n\n\n\n唯一小瑕疵就是後擋板微氧化+微銹以及擋板內側幾點微鏽斑、焊在板卡上的所有輸出接口外觀都有些氧化跡象。\n\n應該是前賣家所使用痕跡不影響使用。(介意者請繞道)\n\n\n\n若有下訂會再裝機測試一段時間，確認沒有問題會準備出貨。\n\n\n\n(p.s.若走別的賣場可直接算1900元免運有興趣請聊聊私我)\n\n\n\n注意:不議價且售出後不可退貨但也請立即裝機測試，在完成訂單前有任何問題都可以私我反應。','此顯卡為蝦皮購買二手顯卡。  無盒裝，橘色防塵塞前賣家還留著，黑色HDMIx1及金手指保護套則自己另外購買補上。','二手 MSI GTX1060 6G ARMOR 顯示卡','2025-06-14 16:35:21.199220',42),(43,'2025-06-16 00:20:43.517428','111111','高性能桌面處理器，手動添加用於API測試。','ASUS/華碩/DAUL-GTX 1060 O6G','2025-06-16 00:20:43.517428',43);
/*!40000 ALTER TABLE `product_content` ENABLE KEYS */;
